import React from 'react'
import "./video.css"

function Video() {
  return (
    <div className='video'>
        <video 
            className='video_player'
            width="1519" height="545" src="https://www.youtube.com/embed/tLVMqh-vMMY" title="Operação de Caça Visto por dentro + Decolagem de porta aviões" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></video>
        </div>
  )
}

export default Video
